import collections
import json
import time
from json import JSONDecodeError

import requests
import sys


def farenheit_to_celsius(f_temp):
    return (f_temp - 32) * 5.0 / 9.0


class WGQueryWeather(object):
    def __init__(self):
        print("Instance Created")

    def __call__(self, apiKey):
        try:
            self.print_indoortemp_from_json(
                self.wg_features_request(
                    apiKey, self.wg_info_request(apiKey)))
        except JSONDecodeError as jsonerror:
            print('JSONDecodeError: {}: {}'.format(jsonerror.doc, jsonerror))
        except Exception as error:
            print('Exception: {}'.format(error))

    def wg_info_request(self, apiKey):
        # api-endpoint
        URL = "https://api.weather.com/v2/vector-api/products/614/info"

        # defining a params dict for the parameters to be sent to the API
        PARAMS = {'apiKey': apiKey,
                  'tile-size': 512,
                  'meta': 'true'}

        # sending get request and saving the response as response object
        r = requests.get(url=URL, params=PARAMS)

        # extracting data in json format
        data = r.json()

        # for timerange in data['products']['614']['time']:
        #     print(timerange)

        return data['products']['614']['time']

    def wg_features_request(self, apiKey, timerange_list):
        # api-endpoint
        URL = "https://api3.weather.com/v2/vector-api/products/614/features"

        # defining a params dict for the parameters to be sent to the API
        PARAMS = {'apiKey': apiKey,
                  'tile-size': 512,
                  'x': 1178,
                  'y': 656,
                  'time': timerange_list,
                  'lod': 12,
                  'stepped': 'true'}

        # sending get request and saving the response as response object
        r = requests.get(url=URL, params=PARAMS)

        # extracting data in json format
        data = r.json()

        return data


    def print_indoortemp_from_json(self, wgdata):
        wgd_sorted = collections.OrderedDict(sorted(wgdata.items()))
        for range, feature_collection in wgd_sorted.items():
            r_start = range.split("-")[0]
            for feature in feature_collection.get('features'):
                print((time.strftime("%m/%d/%Y, %H:%M:%S", time.localtime(int(r_start) / 1000)),
                       farenheit_to_celsius(feature.get('properties').get('indoortempf'))))

    def print_indoortemp_from_payload(self, payload):
        self.print_indoortemp_from_json(json.load(payload))


